from nltk import word_tokenize
import string
from nltk.sentiment.util import *
from nltk.sentiment.vader import SentimentIntensityAnalyzer
from sklearn.feature_extraction.text import TfidfVectorizer
from sklearn.feature_extraction.text import CountVectorizer
from sklearn.externals import joblib
import numpy as np


def sentiment_score(input_list):
    scores = []
    sid = SentimentIntensityAnalyzer()
    for sentence in input_list:
        #print(sentence)
        ss = sid.polarity_scores(sentence)
        # print(ss)
        scores.append((ss['pos']+ss['neg'])/2)
        # scores.append(ss['compound'])
    return np.array([scores])

def tokenization_w(list):
    tokens_list = []
    translator = str.maketrans('', '', string.punctuation)
    for item in list:
        tokens_list.append(word_tokenize(item.translate(translator)))
    return tokens_list

def tokenization(list):
    tokens_list = []
    translator = str.maketrans('', '', string.punctuation)
    for item in list:
        tokens_list.append(word_tokenize(item))
    return tokens_list

def word_count(list):
    results = []
    for item in list:
        results.append(len(item))
    return np.array([results])

def postag(list):
    postag_list = []
    for item in list:
        postag_list.append(nltk.pos_tag(item))
    return postag_list

def get_tags(list):
    tag_list = []
    for item in list:
        tags = []
        for word,tag in item:
            tags.append(tag)
        tag_list.append(tags)
    return tag_list

def count_tag(list):
    result = []
    tags = ['nn', 'dt', 'in', 'jj', 'rb', 'vb', 'prp', 'nns', 'cc', 'vbz', 'vbp','jjs',',' 'to','vbd', 'vbg', 'vbn',
            'cd', 'prp$','jjr', 'rp', 'wrb', 'wdt', 'wp', 'rbr', 'pos',
            '$', 'pdt', 'nnp', 'rbs']
    cv = TfidfVectorizer(vocabulary=tags)
    for item in list:
        data = cv.fit_transform(item).toarray()
        d_list = np.array(data.sum(axis=0))
        result.append(d_list)
    return np.array(result)

def combine_score(list1,list2):
    results = np.concatenate((list1,list2.T),axis=1)
    return results

def get_feature_scores(list):
    tokens = tokenization(list)
    token_w = tokenization_w(list)
    freq = tfidf(list)
    pos = postag(tokens)
    tag_scores = count_tag(get_tags(pos))
    combined = np.concatenate([freq,tag_scores],axis=1)
    word = word_count(token_w)
    subject = subjectivity_scores(tokens)
    sentiment = sentiment_score(list)
    s1 = combine_score(combined, word)
    print('added word length scores')
    s2 = combine_score(s1, subject)
    print('added subjectivity scores')
    results = combine_score(s2, sentiment)
    print('added sentiment scores')
    print('scores ready')
    return results

