def subjectivity_scores(list):
    results = []
    filename = 'sentiment_analyzer.joblib.pkl'
    sentiment = joblib.load(filename)
    for item in list:
        label = sentiment.classify(dict(('contains(%s)' % w, True) for w in item))
        # results.append(label)
        # for l in label.samples():
        #     print("%s: %f" % ('subj', label.prob('subj')))
        # results.append(label.prob('subj'))
        if label == 'obj':
            results.append(1)
        else:
            results.append(0)
    return np.array([results])

def output_scores(results,statements,scores):
    confidence = []
    for score1,score2 in scores:
        if score1 > score2:
            confidence.append(score1)
        else:
            confidence.append(score2)
    result = zip(confidence,results,statements)
    r = list(result)
    return sorted(r, key=lambda tup:tup[0],reverse=True)

def print_output(output):
    for item in output:
        print(item[0],end="\n")
        print(item[1],end="\n")
        print(item[2],end="\n")
        print("\n")